import React from 'react'
import lists from "../../data";
import './Home.css'
import Cards from '../Cards/Cards';

const Home = (props) => {
  console.log(lists.filter(user=>user.title.toLowerCase().includes(props.search)))
  return (
    <section>
        {
           lists.map((list)=>(
             <Cards key={list.id} product={list} handleClick={props.handleClick}/>
           ))
        }
    </section>
  )
}

export default Home
